issue.body:
**Describe the bug**
Hi,
I am trying to write inference code for onnx model, stuck at this errror
`  File "/home/cogknit/anaconda3/envs/tts/lib/python3.7/site-packages/onnxruntime/capi/onnxruntime_inference_collection.py", line 192, in run
    return self._sess.run(output_names, input_feed, run_options)
onnxruntime.capi.onnxruntime_pybind11_state.RuntimeException: [ONNXRuntimeError] : 6 : RUNTIME_EXCEPTION : Non-zero status code returned while running Mul node. Name:'Mul_2142' Status Message: /onnxruntime_src/onnxruntime/core/providers/cpu/math/element_wise_ops.h:497 void onnxruntime::BroadcastIterator::Init(ptrdiff_t, ptrdiff_t) axis == 1 || axis == largest was false. Attempting to broadcast an axis by a dimension other than 1. 194 by 202
`

If gives error also if I pass input of variable length.
`onnxruntime.capi.onnxruntime_pybind11_state.RuntimeException: [ONNXRuntimeError] : 6 : RUNTIME_EXCEPTION : Non-zero status code returned while running Reshape node. Name:'Reshape_2115' Status Message: /onnxruntime_src/onnxruntime/core/providers/cpu/tensor/reshape_helper.h:41 onnxruntime::ReshapeHelper::ReshapeHelper(const onnxruntime::TensorShape&, std::vector<long int>&, bool) gsl::narrow_cast<int64_t>(input_shape.Size()) == size was false. The input tensor cannot be reshaped to the requested shape. Input shape:{1,25}, requested shape:{50}
`

This is models dimensions-
`Graph Input] name: input, shape: [0, 0]
[Graph Input] name: input_lengths, shape: [0]
[Graph Output] name: output, shape: [0, 0, 0]
`

`[name: "input"
type {
  tensor_type {
    elem_type: 7
    shape {
      dim {
        dim_param: "batch_size"
      }
      dim {
        dim_param: "phonemes"
      }
    }
  }
}
, name: "input_lengths"
type {
  tensor_type {
    elem_type: 7
    shape {
      dim {
        dim_param: "batch_size"
      }
    }
  }
}
]
[name: "output"
type {
  tensor_type {
    elem_type: 1
    shape {
      dim {
        dim_param: "batch_size"
      }
      dim {
        dim_param: "Muloutput_dim_1"
      }
      dim {
        dim_param: "Muloutput_dim_2"
      }
    }
  }
}
]
`

**Urgency**
Its a critical error. This is a bottelneck of important demo. If possible, try to resolve this ASAP

**System information**
- OS Platform and Distribution (e.g., Linux Ubuntu 16.04): Linux Ubuntu 20.04
- ONNX Runtime installed from (source or binary): Binary
- ONNX Runtime version: 1.10.0
- Python version: 3.7

**Screenshots**
onnx [model](https://drive.google.com/file/d/1x09B_IaQoDltOYOcXvvD2jgiMkxoR_tW/view?usp=sharing)
